import './App.css';
import React from 'react';
import AddItem from './AddItem'
import Item from './Item'
import { List } from "@material-ui/core";

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      items : [
        {userid : 'jeonSoomin', title : 'springT', type : 't-shirt', sale : true },
        {userid : 'jeonSoomin1', title : 'summerT', type : 't-shirt', sale : false }
      ]
    };
  }

  render(){
    var Items = this.state.items.length > 0 && (
      <div>
        <List>
          {this.state.items.map((item, idx) => (
            <Item

              item = {item} 
              key = {item.title} />
          ))}
        </List>
      </div>
    )
    return (
      <div className = "App">
        {Items}
        <AddItem />
      </div>
    )
  }
}

export default App;
